    { label: "“Add schema to segment”", value: "", disabled: true },
    {
      label: "First Name",
      value: "first_name"
    },
    { label: "Last Name", value: "last_name" },
    { label: "Gender", value: "gender" },
    { label: "Age", value: "age" },
    { label: "Account Name", value: "account_name" },
